function toggleNotes(e){const s=document.getElementById(e);s?s.style&&("table-row"===s.style.display?(s.style.display="none",s.classList.remove("visible")):(s.style.display="table-row",s.classList.add("visible"))):console.warn(`Element with ID ${e} not found`)}function toggleSubs(e){const s=document.getElementById(e);s?s.style&&("block"===s.style.display?(s.style.display="none",s.classList.remove("visible")):(s.style.display="block",s.classList.add("visible"))):console.warn(`Element with ID ${e} not found`)}